  useEffect(()=> {
    const fetchMains = async () => {
      const res = await fetch('http://localhost:5000/mains')
      const data = await res.json()

      console.log(data)
    }
    console.log("fetching mains...")
    fetchMains()

  }, [])

  return (
    <div className="container">
      <Header />
      <Menu />
    </div>
  );
}

export default App;
